import React from "react";
import logo from "../assets/logo.png";
import { Link } from "react-router-dom";

const Header = () => {
  return (
    <header className="bg-[#4a2600] text-white px-6 sm:px-10 py-4 flex justify-between items-center">
      <div className="flex items-center gap-2">
        <Link to="/">
          <img src={logo} alt="Logo" className="w-16 sm:w-20 h-12 sm:h-16 object-contain" />
        </Link>
      </div>
      <nav>
        <ul className="flex gap-4 sm:gap-8 text-xs sm:text-sm font-semibold">
          <li><Link to="/" className="hover:text-amber-200 transition-colors">HOME</Link></li>
          <li><Link to="/about" className="hover:text-amber-200 transition-colors">ABOUT</Link></li>
          <li><Link to="/menu" className="hover:text-amber-200 transition-colors">MENU</Link></li>
          <li><Link to="/services" className="hover:text-amber-200 transition-colors">SERVICES</Link></li>
          <li><Link to="/contact" className="hover:text-amber-200 transition-colors">CONTACT</Link></li>
        </ul>
      </nav>
      <Link
        to="/login"
        className="bg-[#8a4b27] px-3 sm:px-4 py-1 sm:py-2 rounded-full shadow-md font-semibold hover:bg-[#6e3a1f] transition-colors text-xs sm:text-base"
      >
        LOGIN
      </Link>
    </header>
  );
};

export default Header;
